import{_ as e,o as l,c as i,e as c}from"./app-lbpz4_ze.js";const o={},d=c('<h1 id="互通服指令" tabindex="-1"><a class="header-anchor" href="#互通服指令"><span>互通服指令</span></a></h1><h2 id="格式说明" tabindex="-1"><a class="header-anchor" href="#格式说明"><span>格式说明</span></a></h2><ul><li>菱形括号内容代表必填变量，例如你想传送Steve，应该将<code>/tpa &lt;玩家名&gt;</code>当成<code>/tpa Steve</code>使用。</li><li>方形括号内容代表可选变量。</li></ul><h2 id="常用命令" tabindex="-1"><a class="header-anchor" href="#常用命令"><span>常用命令</span></a></h2><ul><li><code>/tpa &lt;玩家名&gt;</code>: 发送一个传送请求给指定玩家。</li><li><code>/tpahere &lt;玩家名&gt;</code>: 发送一个传送请求，将指定玩家传送到你的位置。</li><li><code>/tpaccept</code>: 接受传送请求。</li></ul><ul><li><code>/buyclaimblocks &lt;圈地币数量&gt;</code>: 将金币兑换为圈地币。</li><li><code>/Trust &lt;玩家名&gt;</code>: 授予另一名玩家编辑你的领地的权限。</li><li><code>/UnTrust &lt;玩家名&gt;</code>: 收回另一名玩家编辑你的领地的权限。</li><li><code>/abandonclaim</code>: 删除你当前所在的领地。</li><li><code>/money</code>: 显示金币数量。</li><li><code>/pay &lt;玩家名&gt; &lt;金额&gt;</code>: 向其他玩家转账。</li><li><code>/slimefun guide</code>: 重新获得粘液科技指南。</li><li><code>/shop</code>: 打开商店。</li></ul><h2 id="以下为全部命令" tabindex="-1"><a class="header-anchor" href="#以下为全部命令"><span>以下为全部命令</span></a></h2><h3 id="玩家互传" tabindex="-1"><a class="header-anchor" href="#玩家互传"><span>玩家互传</span></a></h3><ul><li><code>/tpa [player]</code>: 发送一个传送请求给指定玩家。</li><li><code>/tpahere [player]</code>: 发送一个传送请求，将指定玩家传送到你的位置。</li><li><code>/tpahereall</code>: 发送一个传送请求，将所有玩家传送到你的位置。</li><li><code>/tpaccept</code>: 接受传送请求。</li><li><code>/tpatoggle</code>: 禁用/启用传送到你这里。</li><li><code>/tpatoggle [player]</code>: 禁用/启用传送到特定玩家。</li><li><code>/tpdeny</code>: 拒绝传送请求。</li><li><code>/back</code>: 将你传送回你的最后位置。</li><li><code>/tpcancel [player]</code>: 取消对特定玩家的传送请求。</li><li><code>/simpletpa</code>: 打开主菜单。</li></ul><h3 id="家-传送点" tabindex="-1"><a class="header-anchor" href="#家-传送点"><span>家（传送点）</span></a></h3><ul><li><code>/sethome</code>: 将当前位置设为你的家。</li><li><code>/home</code>: 传送到你设置的家那里。</li><li><code>/homes</code>: 列出我的所有家。</li><li><code>/deletehome</code>: 删除之前设置的家。</li></ul><h3 id="领地" tabindex="-1"><a class="header-anchor" href="#领地"><span>领地</span></a></h3><ul><li><code>/abandonclaim</code>: 删除你当前所在的领地。</li><li><code>/claimexplosions</code>: 切换当前的领地是否允许爆炸。</li><li><code>/trust</code>: 授予另一名玩家编辑你的领地的权限。</li><li><code>/untrust</code>: 收回另一名玩家编辑你的领地的权限。</li><li><code>/accesstrust</code>: 授予另一名玩家使用你的领地的按钮、拉杆和床的权限。</li><li><code>/containertrust</code>: 授予另一名玩家使用你领地的拉杆、床、容器、动物的权限。</li><li><code>/trustlist</code>: 列出你当前所在领地的授权列表。</li><li><code>/subdivideclaims</code>: 将你的铲子切换到划分模式，以便你可以细分你的子领地。</li><li><code>/restrictsubclaim</code>: 限制一个子领地，以免子领地从副领地继承授权信息。</li><li><code>/basicclaims</code>: 将你的铲子切换回基本圈地模式。</li><li><code>/permissiontrust</code>: 允许一个玩家向其他玩家分享他在你的领地拥有的权限。</li><li><code>/untrust all</code>: 在你的领地内收回所有玩家的所有权限。</li><li><code>/abandonallclaims</code>: 删除自己的所有领地。</li><li><code>/buyclaimblocks</code>: 将金币兑换为圈地币。</li><li><code>/sellclaimblocks</code>: 将圈地币兑换为金币。</li><li><code>/givepet</code>: 把自己驯服的宠物送给别人。</li><li><code>/claimslist</code>: 列出一名玩家的领地列表详细信息。</li><li><code>/ignoreplayer</code>: 屏蔽一名玩家的聊天信息。</li><li><code>/unignoreplayer</code>: 对一名玩家的聊天信息解除屏蔽。</li><li><code>/ignoredplayerlist</code>: 列出自己屏蔽的玩家列表。</li><li><code>/siege</code>: Besieges a player (disabled by default).</li><li><code>/trapped</code>: 将一名玩家从他被困到的领地里脱离。</li><li><code>/unlockdrops</code>: 允许其他玩家捡起你的死亡掉落物。</li></ul><h3 id="金币" tabindex="-1"><a class="header-anchor" href="#金币"><span>金币</span></a></h3><ul><li><code>/money</code>: 显示金币数量。</li><li><code>/pay [player] [money]</code>: 向其他玩家转账。</li><li><code>/balancetop</code>: 显示金币排行前十名。</li><li><code>/paytoggle</code>: 切换是否接受转账。</li><li><code>/xconomy help</code>: 查看经济功能的帮助。</li></ul><h3 id="粘液科技" tabindex="-1"><a class="header-anchor" href="#粘液科技"><span>粘液科技</span></a></h3><ul><li><code>/slimefun guide</code>: 重新获得粘液科技指南。</li></ul><h3 id="服务器商店" tabindex="-1"><a class="header-anchor" href="#服务器商店"><span>服务器商店</span></a></h3><ul><li><code>/shop</code>: 打开商店。</li><li><code>/shop &lt;section&gt;</code>: 直接通过命令打开商店的特定部分，而无需先输入/shop再选择商店部分。</li><li><code>/sellall</code>: 卖出你背包里的所有物品。</li><li><code>/sellall &lt;material&gt;</code>: 卖出背包里所有指定材料的物品。</li><li><code>/sellall hand</code>: 卖出你当前手持的物品堆。</li><li><code>/sellgui [player]</code>: 打开一个空背包界面，用于放入并出售物品。关闭背包将完成交易，并退还无法出售的物品。</li></ul>',19),a=[d];function t(n,s){return l(),i("div",null,a)}const h=e(o,[["render",t],["__file","command.html.vue"]]),p=JSON.parse('{"path":"/docs/others/command.html","title":"互通服指令","lang":"zh-CN","frontmatter":{},"headers":[{"level":2,"title":"格式说明","slug":"格式说明","link":"#格式说明","children":[]},{"level":2,"title":"常用命令","slug":"常用命令","link":"#常用命令","children":[]},{"level":2,"title":"以下为全部命令","slug":"以下为全部命令","link":"#以下为全部命令","children":[{"level":3,"title":"玩家互传","slug":"玩家互传","link":"#玩家互传","children":[]},{"level":3,"title":"家（传送点）","slug":"家-传送点","link":"#家-传送点","children":[]},{"level":3,"title":"领地","slug":"领地","link":"#领地","children":[]},{"level":3,"title":"金币","slug":"金币","link":"#金币","children":[]},{"level":3,"title":"粘液科技","slug":"粘液科技","link":"#粘液科技","children":[]},{"level":3,"title":"服务器商店","slug":"服务器商店","link":"#服务器商店","children":[]}]}],"git":{"createdTime":1713185255000,"updatedTime":1713185255000,"contributors":[{"name":"Nerakolo","email":"nerakolo@outlook.com","commits":1}]},"filePathRelative":"docs/others/command.md","excerpt":"\\n<h2>格式说明</h2>\\n<ul>\\n<li>菱形括号内容代表必填变量，例如你想传送Steve，应该将<code>/tpa &lt;玩家名&gt;</code>当成<code>/tpa Steve</code>使用。</li>\\n<li>方形括号内容代表可选变量。</li>\\n</ul>\\n<h2>常用命令</h2>\\n<ul>\\n<li><code>/tpa &lt;玩家名&gt;</code>: 发送一个传送请求给指定玩家。</li>\\n<li><code>/tpahere &lt;玩家名&gt;</code>: 发送一个传送请求，将指定玩家传送到你的位置。</li>\\n<li><code>/tpaccept</code>: 接受传送请求。</li>\\n</ul>"}');export{h as comp,p as data};
